import React from "react";
import ReactDOM from "react-dom";
import "./main.css"

function App(){
  return    <div className="first">
                <h1>Hello React</h1>
                <img src="event.jpeg" alt="event" />
                <h3>Coders Rank</h3>
                 <p>The ultimate profile for developers</p>
             </div>
}

ReactDOM.render(App(), document.getElementById("root"))
